  var testcontract;
  const code = "thezeostoken";
  let dappClient;
  let storageClient;
  const boxDir = getBoxesDir();
  const permission = "active";
  const keys = await getCreateKeys(code);
  const key = keys.active.privateKey;
  var proof_ipfs;

